import React from "react";
import { BrowserRouter as Router, Route} from "react-router-dom";
import './App.css';
import User from "./Router/components/pages/User";

function App() {
  return (
    <Router>
      <div>
          <Route exact path="/" component={User} />
      </div>
    </Router>

  );
}

export default App;
